#include <bits/stdc++.h>
using namespace std;
class Solution {
public:
    string lastSubstring(string s) {
        char max_c='a';
        vector<int>index;
        int j=0;
        for(int i=0;i<s.size(); i++){
            if(s[i]>=max_c)
            {
                if(s[i]==max_c){
                    string a=s.substr(i,s.size());
                    string b=s.substr(j, s.size());
                    if(a>b){
                        max_c=s[i];
                        index.push_back(i);
                        j=i;
                    }
                }
                else if(s[i]>max_c){
                    max_c=s[i];
                    index.push_back(i);
                    j=i;
                }

            }
        }
        if(max_c=='a' and index.size()==0){
            index.push_back(0);
        }
        cout<<"size of index vector "<<index.size()<<endl;

        //for others, get all substrins for these indexes, here the question only aks for last
        //last substring will be biggest so the starting index in index vector
        // vector<int>right_index=index[max_c-'a'];
        string ans="";
        for(auto i: index)
        {
            string as=s.substr(i, s.size());
            ans=max(ans, as);
        }
        return ans;
    }
};
int main (){
    string s="";
    Solution sl;
    cout<<sl.lastSubstring(s);
}